import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useState, useEffect } from 'react';
import CoverSlide from './slides/CoverSlide';
import BigIdeaSlide from './slides/BigIdeaSlide';
import MarketStrategiesSlide from './slides/MarketStrategiesSlide';
import RevenuePotentialSlide from './slides/RevenuePotentialSlide';
import PartnershipsSlide from './slides/PartnershipsSlide';
import DeliverableSlide from './slides/DeliverableSlide';
import ViralStrategySlide from './slides/ViralStrategySlide';

const PalmTree = () => (
  <PalmTreeSVG viewBox="0 0 100 150" xmlns="http://www.w3.org/2000/svg">
    <path
      d="M50 150c0 0 5-40 5-50 0-10-1-15-1-15s15 2 25-10c10-12 10-25 5-30s-20-5-25 5c0 0 5-20-5-30s-25-5-30 0 0 20 10 25c0 0-15-5-25 5s-5 25 5 30c10 5 25 0 25 0s-1 5-1 15c0 10 5 50 5 50"
      fill="#22c55e"
    />
    <path
      d="M45 85c0 0 2-30 2-35 0-5-1-10-1-10s10 2 15-5c5-7 5-15 2-18s-12-3-15 3c0 0 3-12-3-18s-15-3-18 0 0 12 6 15c0 0-9-3-15 3s-3 15 3 18c6 3 15 0 15 0s0 5 0 10c0 5 2 35 2 35"
      fill="#16a34a"
    />
  </PalmTreeSVG>
);

const PitchDeck = () => {
  useEffect(() => {
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    canvas.style.position = 'fixed';
    canvas.style.top = '0';
    canvas.style.left = '0';
    canvas.style.width = '100%';
    canvas.style.height = '100%';
    canvas.style.pointerEvents = 'none';
    canvas.style.zIndex = '1';
    document.body.appendChild(canvas);

    const resizeCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };
    
    window.addEventListener('resize', resizeCanvas);
    resizeCanvas();

    const afrobeatsColors = [
      'rgba(255, 215, 0, 0.2)',   // Brighter Gold
      'rgba(147, 51, 234, 0.2)',  // Vibrant Purple
      'rgba(34, 197, 94, 0.2)',   // Fresh Green
      'rgba(253, 224, 71, 0.2)',  // Sunny Yellow
      'rgba(236, 72, 153, 0.2)',  // Hot Pink
      'rgba(249, 115, 22, 0.2)',  // Orange
      'rgba(59, 130, 246, 0.2)'   // Blue
    ];

    const symbols = ['â™ª', 'â™«', 'â™¬', 'ðŸŽµ', 'ðŸŽ¶'];
    const symbolsArray = [];

    for (let i = 0; i < 50; i++) {
      symbolsArray.push({
        x: Math.random() * canvas.width,
        y: Math.random() * canvas.height,
        symbol: symbols[Math.floor(Math.random() * symbols.length)],
        color: afrobeatsColors[Math.floor(Math.random() * afrobeatsColors.length)],
        size: 20 + Math.random() * 40,
        rotation: Math.random() * Math.PI * 2,
        speed: 0.2 + Math.random() * 0.5
      });
    }

    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      symbolsArray.forEach(symbol => {
        ctx.save();
        ctx.translate(symbol.x, symbol.y);
        ctx.rotate(symbol.rotation);
        ctx.font = `${symbol.size}px Arial`;
        ctx.fillStyle = symbol.color;
        ctx.fillText(symbol.symbol, 0, 0);
        ctx.restore();

        symbol.y -= symbol.speed;
        symbol.rotation += 0.01;

        if (symbol.y < -50) {
          symbol.y = canvas.height + 50;
          symbol.x = Math.random() * canvas.width;
        }
      });

      requestAnimationFrame(animate);
    };

    animate();

    return () => {
      window.removeEventListener('resize', resizeCanvas);
      document.body.removeChild(canvas);
    };
  }, []);

  return (
    <DeckContainer>
      <SlideWrapper>
        <GradientOverlay />
        <PalmTreeContainer>
          <PalmTree />
        </PalmTreeContainer>
        <SlideContent>
          <CoverSlide />
        </SlideContent>
      </SlideWrapper>
      <SlideWrapper>
        <SlideContent>
          <BigIdeaSlide />
        </SlideContent>
      </SlideWrapper>
      <SlideWrapper>
        <SlideContent>
          <MarketStrategiesSlide />
        </SlideContent>
      </SlideWrapper>
      <SlideWrapper>
        <SlideContent>
          <RevenuePotentialSlide />
        </SlideContent>
      </SlideWrapper>
      <SlideWrapper>
        <SlideContent>
          <PartnershipsSlide />
        </SlideContent>
      </SlideWrapper>
      <SlideWrapper>
        <SlideContent>
          <DeliverableSlide />
        </SlideContent>
      </SlideWrapper>
      <SlideWrapper>
        <SlideContent>
          <ViralStrategySlide />
        </SlideContent>
      </SlideWrapper>
    </DeckContainer>
  );
};

const DeckContainer = styled.div`
  width: 100vw;
  min-height: 100vh;
  margin: 0;
  padding: 0;
  background: linear-gradient(
    135deg,
    #0f172a 0%,
    #1e1b4b 50%,
    #312e81 100%
  );
  overflow-x: hidden;
`;

const SlideWrapper = styled.div`
  min-height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0;
  padding: 2rem;
  position: relative;
  overflow: hidden;

  @media (min-width: 1920px) {
    padding: 4rem;
  }
`;

const GradientOverlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: linear-gradient(
    45deg,
    rgba(255, 215, 0, 0.1),
    rgba(147, 51, 234, 0.1),
    rgba(34, 197, 94, 0.1)
  );
  z-index: 1;
`;

const PalmTreeContainer = styled.div`
  position: absolute;
  bottom: 0;
  left: 5%;
  width: 200px;
  height: 300px;
  z-index: 2;
  animation: sway 5s ease-in-out infinite;

  @keyframes sway {
    0%, 100% { transform: rotate(-2deg); }
    50% { transform: rotate(2deg); }
  }
`;

const PalmTreeSVG = styled.svg`
  width: 100%;
  height: 100%;
  filter: drop-shadow(0 0 10px rgba(34, 197, 94, 0.3));
`;

const SlideContent = styled.div`
  width: 100%;
  max-width: 1920px;
  aspect-ratio: 16/9;
  display: flex;
  align-items: center;
  justify-content: center;
  transform-origin: center;
  background: transparent;
  position: relative;
  z-index: 2;

  @media (max-width: 1920px) {
    transform: scale(${props => Math.min(window.innerWidth / 1920, 1)});
  }
`;

export default PitchDeck;
